import logo from './logo.svg';
import './App.css';

function App() {
	const options = {
		method: 'GET',
		headers: {accept: 'application/json', 'x-api-key': '72d6be3878ab443b921b6b9f8906225a'},
	};

	fetch('https://api.opensea.io/api/v2/collections?chain_identifier=ethereum', options)
		.then(response => response.json())
		.then(response => console.log(response.collections.name))
		.catch(error => console.error(error));
	return (
		<div className='App'>
			<header className='App-header'>
				<img src={logo} className='App-logo' alt='logo' />
				<p>
          Edit <code>src/App.js</code> and save to reload.
				</p>
				<a
					className='App-link'
					href='https://reactjs.org'
					target='_blank'
					rel='noopener noreferrer'
				>
          Learn React
				</a>
			</header>
		</div>
	);
}

export default App;
